import React from "react";

function TodoItem(props) {
  const answerLabel = props.attributes.answer ? "Answer: " : "No response";
  //   if (props.attributes.answer !== undefined || props.attributes.answer !== null) {
  //     answerLabel = "Answer: ";
  //   } else {
  //     answerLabel = "No response";
  //   }

  return (
    <div>
      <div>Question: {props.attributes.question} </div>
      <div style={{ backgroundColor: !props.attributes.answer && "pink" }}>
        {answerLabel}
        {props.attributes.answer}
      </div>
    </div>

    // <div className="flex-row-center">
    //   <input type="checkbox"></input>to do
    // </div>
  );
}

export default TodoItem;
